INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (1, 2, 1, 0, 24001, 1, 321, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", "リリ", 125801, 40011);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (1, 2, 2, 0, 24001, 1, 322, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", "クリア", 126001, 40011);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (1, 2, 3, 0, 24001, 1, 323, "んーと。\nこれ、あげる。\nはい", "プレシア", 126101, 40011);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (2, 2, 4, 0, 24001, 1, 324, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", "リリ", 125801, 40011);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (2, 2, 5, 0, 24001, 1, 325, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", "クリア", 126001, 40011);
INSERT INTO `v1_229fea044fdd2bf171a3b6b05c1e520bd000e10556fa8239944e311d5c02ca79` VALUES (2, 2, 6, 0, 24001, 1, 326, "お兄。\nきてくれて、うれしい", "プレシア", 126101, 40011);
